'''Barb''', the '''Banker tutor''', is a [[non-player character]] located in [[Lumbridge]], on the {{FloorNumber|uk=2}} of the [[Lumbridge Castle]]. She teaches players about how the [[bank]] and [[bank PIN]] numbers work. In addition to that, she also serves as a [[banker]] within the castle, allowing you to have the option to store or collect items from her.

